import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter as Router,
  Routes,
  Route,

} from "react-router-dom";


export default class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <Navbar></Navbar>
          <Routes>
            <Route path="/" element = {<News pageSize={5} country="in" category="general"></News>}/>
            <Route path="/General" element = {<News pageSize={5} country="in" category="general"></News>}/>
            <Route path="/Science" element = {<News pageSize={5} country="in" category="Science"></News>}/>
            <Route path="/Buisness" element = {<News pageSize={5} country="in" category="Buisness"></News>}/>
            <Route path="/Entertainment" element = {<News pageSize={5} country="in" category="Entertainment"></News>}/>
            <Route path="/Sports" element = {<News pageSize={5} country="in" category="Sports"></News>}/>
            <Route path="/Health" element = {<News pageSize={5} country="in" category="Health"></News>}/>
            <Route path="/Technology" element = {<News pageSize={5} country="in" category="Technology"></News>}/>


          </Routes>
        </div>
      </Router>

    )
  }
}
